sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  var inputValue = inputs.input_value;
  outputs.encoded_input = gs.urlEncode(inputValue);
  var apiKey = gs.getProperty('x_snc_google_map.api.key');
  inputValue = inputValue.substring(0,inputValue.length-1);
  var urlValue = gs.urlEncode(inputValue);
  outputs.api_key = apiKey;
//  var restURL = 'https://maps.googleapis.com/maps/api/place/autocomplete/json?input=' + inputValue + '&key=' + apiKey;
  var restURL = 'https://maps.googleapis.com/maps/api/place/autocomplete/json?input='+urlValue+'&key='+apiKey;
  outputs.rest_url = restURL;
})(inputs, outputs);

